import React from "react";

const CTA = () => {
    return (
        <section id="cta" className="text-center py-5 text-white">
            <div className="container">
                <h2>Unleash Your Creativity Today</h2>
                <p>Join our community of creators and bring your ideas to life with ease!</p>
                <a href="#signup" className="btn btn-light">Sign Up</a>
            </div>
        </section>
    );
};

export default CTA;
